INSERT INTO `description` (`id`, `title_name`, `description`) VALUES
(1, 'Just For Moms', 'We saw a need for affordable and trendy maternity clothes, and worked hard to provide that. Starting out, our mission was to develop a brand that fully encompassed #momlife and provided more than just clothing to our customers. We pride ourselves in the community we have created through the years as well as the selection of quality crafted clothing that caters to every need you will have through your pregnancy and after! We stand by our product and ensure that you will have a wonderful shopping experience with us from our incredible customer support team to our easy to shop website.'),
(2, 'Before - During - After', 'Pregnancy is an extremely special time in your life. We are here to provide you with everything you will need during this time and after. Our clothing is designed to be worn both during pregnancy and after! We know that versatility is key and having pieces in your wardrobe that can transition through every stage of life is important -- and our unique designs can provide that! With timeless styles and flattering silhouettes, we are sure that our collection of styles will fit your every need.'),
(3, 'Just For Babies', 'We saw a need for affordable and trendy baby clothes, and worked hard to provide that. Starting out, our mission was to develop a brand that fully encompassed #momlifewithherbaby and provided more than just clothing to our customers. We pride ourselves in the community we have created through the years as well as the selection of quality crafted clothing and food and other essential things that caters to every need you will have through your pregnancy and after! We stand by our product and ensure that you will have a wonderful shopping experience with us from our incredible customer support team to our easy to shop website.'),
(4, 'Our Mission', 'At Maternity In Style, we have a group of creative team members who are extremely passionate about the work we do here. Special thought and care are put into every piece of clothing created to ensure perfection for our customers. Our mission is to not only provide the perfect outfit for every occasion to our customers, but to also create a supportive community of moms.'),
(5, 'Inspired By You', 'Our beautiful customers and collaborators are our biggest inspiration. We love seeing the daily lives of our mom tribe and curating our collection based off your needs. Each and every style we develop is catered towards every aspect of #momlife - from dresses for every special occasion to jeans and tees for day-to-day wear and even sleep and longewear to chill in at home! We are here to support every moment in your life from baby showers to baby\'s 1st birthday!'),
(6, 'Inspired By You', 'Our beautiful customers and collaborators are our biggest inspiration. We love seeing the daily lives of our mom tribe and curating our collection based off your needs. Each and every style we develop is catered towards every aspect of #momlife - from dresses for every special occasion to jeans and tees for day-to-day wear and even sleep and longewear to chill in at home! We are here to support every moment in your life from baby showers to baby\'s 1st birthday!');
